import React from 'react';
import styled from 'styled-components';
import Link from './Link';

const Header = styled.div`
	text-align: left;
	height: 43px;
	line-height: 43px;
	border-bottom: 1px solid #e2e8ed;
	position: absolute;
	top: 0px;
	left: 0px;
	width: 100%;

	&.white {
		background: #ffffff;
	}
	&.black {
		background: #0b0102;
	}
	&.hidden {
		display: none;
	}
`;

const CoxLogo = styled.img`
	width: auto;
	height: 23px;
	margin: 9.5px 25px;
`;

const HomeNav = styled(Link)`
	text-decoration: none;
`;

const header = (props) => (
	<Header className={props.status}>
		<HomeNav to="/"><CoxLogo src="assets/images/cox-logo-gradient.png" alt="cox logo" /></HomeNav>
	</Header>
)

export default header;
